import './assets/css/selectize.css';
import './assets/css/style.css';
import './assets/css/user.css';

function App() {
  return (
    <BrowserRouter>      
      <Switch>
          <Route exact path="/badges" component={ Badges } />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
